#!/usr/bin/python3def safe_print_list_integers(my_list=[], x=0):    """    a function that prints the first x elements    of a list and only integers    """    counter = iter = 0    end = x    while x and iter < end:        try:            print("{:d}".format(my_list[iter]), end="")            x -= 1            counter += 1        except (ValueError, TypeError):            ...        iter += 1    print()    return counter